import styled from "styled-components";

export const Header = styled.div`
  max-height: 85px;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
  .navbar {
    display: flex;
    flex-direction: row;
    padding: 5px;
    box-sizing: border-box;
    list-style: none;
  }
`;
